const stringThousand = "天地玄黃，宇宙洪荒。日月盈昃，辰宿列張。寒來暑往，秋收冬藏。閏餘成歲，律呂調陽。雲騰致雨，露結為霜。金生麗水，玉出崑崗。劍號巨闕，珠稱夜光。果珍李柰，菜重芥薑。海鹹河淡，鱗潛羽翔。龍師火帝，鳥官人皇。始制文字，乃服衣裳。推位讓國，有虞陶唐。弔民伐罪，周發殷湯。坐朝問道，垂拱平章。愛育黎首，臣伏戎羌。遐邇壹體，率賓歸王。鳴鳳在樹，白駒食場。化被草木，賴及萬方。蓋此身髮，四大五常。恭惟鞠養，豈敢毀傷。女慕貞絜，男效才良。知過必改，得能莫忘。罔談彼短，靡恃己長。信使可覆，器欲難量。墨悲絲染，詩讚羔羊。景行維賢，剋念作聖。德建名立，形端表正。空谷傳聲，虛堂習聽。禍因惡積，福緣善慶。尺璧非寶，寸陰是競。資父事君，曰嚴與敬。孝當竭力，忠則盡命。臨深履薄，夙興溫凊。似蘭斯馨，如松之盛。川流不息，淵澄取映。容止若思，言辭安定。篤初誠美，慎終宜令。榮業所基，藉甚無竟。學優登仕，攝職從政。存以甘棠，去而益詠。樂殊貴賤，禮別尊卑。上和下睦，夫唱婦隨。外受傅訓，入奉母儀。諸姑伯叔，猶子比兒。孔懷兄弟，同氣連枝。交友投分，切磨箴規。仁慈隱惻，造次弗離。節義廉退，顛沛匪虧。性靜情逸，心動神疲。守真志滿，逐物意移。堅持雅操，好爵自縻。都邑華夏，東西二京。背邙面洛，浮渭據涇。宮殿盤鬱，樓觀飛驚。圖寫禽獸，畫綵仙靈。丙舍傍啟，甲帳對楹。肆筵設席，鼓瑟吹笙。升階納陛，弁轉疑星。右通廣內，左達承明。既集墳典，亦聚群英。杜稿鍾隸，漆書壁經。府羅將相，路俠槐卿。戶封八縣，家給千兵。高冠陪輦，驅轂振纓。世祿侈富，車駕肥輕。策功茂實，勒碑刻銘。磻溪伊尹，佐時阿衡。奄宅曲阜，微旦孰營。桓公匡合，濟弱扶傾。綺迴漢惠，說感武丁。俊乂密勿，多士寔寧。晉楚更霸，趙魏困橫。假途滅虢，踐土會盟。何遵約法，韓弊煩刑。起翦頗牧，用軍最精。宣威沙漠，馳譽丹青。九州禹跡，百郡秦并。嶽宗恒岱，禪主云亭。雁門紫塞，雞田赤城。昆池碣石，鉅野洞庭。曠遠綿邈，巖岫杳冥。治本於農，務茲稼穡。俶載南畝，我藝黍稷。稅熟貢新，勸賞黜陟。孟軻敦素，史魚秉直。庶幾中庸，勞謙謹敕。聆音察理，鑒貌辨色。貽厥嘉猷，勉其祗植。省躬譏誡，寵增抗極。殆辱近恥，林皋幸即。兩疏見機，解組誰逼。索居閒處，沉默寂寥。求古尋論，散慮逍遙。欣奏累遣，慼謝歡招。渠荷的歷，園莽抽條。枇杷晚翠，梧桐早凋。陳根委翳，落葉飄颻。遊鵾獨運，凌摩絳霄。耽讀翫市，寓目囊箱。易輶攸畏，屬耳垣牆。具膳餐飯，適口充腸。飽飫烹宰，飢厭糟糠。親戚故舊，老少異糧。妾御績紡，侍巾帷房。紈扇圓潔，銀燭煒煌。晝眠夕寐，藍筍象床。弦歌酒宴，接杯舉觴。矯手頓足，悅豫且康。嫡後嗣續，祭祀烝嘗。稽顙再拜，悚懼恐惶。牋牒簡要，顧答審詳。骸垢想浴，執熱願涼。驢騾犢特，駭躍超驤。誅斬賊盜，捕獲叛亡。布射遼丸，嵇琴阮嘯。恬筆倫紙，鈞巧任釣。釋紛利俗，並皆佳妙。毛施淑姿，工顰妍笑。年矢每催，曦暉朗曜。璇璣懸斡，晦魄環照。指薪修祜，永綏吉劭。矩步引領，俯仰廊廟。束帶矜莊，徘徊瞻眺。孤陋寡聞，愚蒙等誚。謂語助者，焉哉乎也。";
const stringHundred = '趙錢孫李周吳鄭王馮陳褚衛蔣沈韓楊朱秦尤許何呂施張孔曹嚴華金魏陶姜戚謝鄒喻柏水竇章雲蘇潘葛奚范彭郎魯韋昌馬苗鳳花方俞任袁柳酆鮑史唐費廉岑薛雷賀倪湯滕殷羅畢郝鄔安常樂于時傅皮卞齊康伍余元卜顧孟平黃和穆蕭尹姚邵湛汪祁毛禹狄米貝明臧計伏成戴談宋茅龎熊紀舒屈項祝董梁杜阮藍閔席季麻強賈路婁危江童顏郭梅盛林刁鍾徐邱駱高夏蔡田樊胡凌霍虞萬支柯昝管盧莫經房裘繆干解應宗丁宣賁鄧郁單杭洪包諸左石崔吉鈕龔程嵇邢滑裴陸榮翁荀羊於惠甄曲家封芮羿儲靳汲邴糜松井段富巫烏焦巴弓牧隗山谷車侯虙蓬全郗班仰秋仲伊宮甯仇欒暴甘鈄厲戎祖武符劉景詹束龍葉幸司韶郜黎薊薄印宿白懷蒲邰從鄂索咸籍賴卓藺屠蒙池喬陰鬱胥能蒼雙聞莘党翟譚貢勞逄姬申扶堵冉宰酈雍郤璩桑桂濮牛壽通邊扈燕冀郟浦尚農溫別莊晏柴瞿閻充慕連茹習宦艾魚容向古易慎戈廖庾終暨居衡步都耿滿弘匡國文寇廣祿闕東歐殳沃利蔚越夔隆師鞏厙聶晁勾敖融冷訾辛闞那簡饒空曾毋沙乜養鞠須豐巢關蒯相查后荊紅游竺權逯蓋益桓公万俟司馬上官歐陽夏侯諸葛聞人東方赫連皇甫尉遲公羊澹臺公冶宗政濮陽淳于單于太叔申屠公孫仲孫軒轅令狐鍾離宇文長孫慕容鮮于閭丘司徒司空丌官司寇仉督子車顓孫端木巫馬公西漆雕樂正壤駟公良拓跋夾谷宰父穀梁晉楚閆法汝鄢涂欽段干百里東郭南門呼延歸海羊舌微生岳帥緱亢況後有琴梁丘左丘東門西門商牟佘佴伯賞南宮墨哈譙笪年愛陽佟第五言福';
const string出師表 = "臣亮言：先帝創業未半而中道崩殂，今天下三分，益州疲敝，此誠危急存亡之秋也。然侍衞之臣不懈於內，忠志之士忘身於外者，蓋追先帝之殊遇，欲報之於陛下也。\n誠宜開張聖聽，以光先帝遺德，恢弘志士之氣，不宜妄自菲薄，引喻失義，以塞忠諫之路也。\n宮中府中，俱爲一體，陟罰臧否，不宜異同。若有作奸犯科及爲忠善者，宜付有司論其刑賞，以昭陛下平明之治，不宜偏私，使內外異法也。\n侍中、侍郎郭攸之、費禕、董允等，此皆良實，志慮忠純，是以先帝簡拔以遺陛下。愚以爲宮中之事，事無大小，悉以咨之，然後施行，必能裨補闕漏，有所廣益。\n將軍向寵，性行淑均，曉暢軍事，試用之於昔日，先帝稱之曰能，是以衆議舉寵爲督。愚以爲營中之事，悉以咨之，必能使行陣和睦，優劣得所也。\n親賢臣，遠小人，此先漢所以興隆也；親小人，遠賢臣，此後漢所以傾頹也。先帝在時，每與臣論此事，未嘗不歎息痛恨於桓、靈也。侍中、尚書、長史、參軍，此悉貞亮死節之臣也，願陛下親之信之，則漢室之隆，可計日而待也。\n臣本布衣，躬耕於南陽，苟全性命於亂世，不求聞達於諸侯。先帝不以臣卑鄙，猥自枉屈，三顧臣於草廬之中，諮臣以當世之事，由是感激，遂許先帝以驅馳。後值傾覆，受任於敗軍之際，奉命於危難之間，爾來二十有一年矣。先帝知臣謹慎，故臨崩寄臣以大事也。受命以來，夙夜憂歎，恐託付不效，以傷先帝之明，故五月渡瀘，深入不毛。今南方已定，兵甲已足，當獎率三軍，北定中原，庶竭駑鈍，攘除姦凶，興復漢室，還于舊都，此臣所以報先帝，而忠陛下之職分也。至於斟酌損益，進盡忠言，則攸之、禕、允之任也。\n願陛下託臣以討賊興復之效；不效，則治臣之罪，以告先帝之靈。若無興德之言，則責攸之、禕、允等之慢，以彰其咎。陛下亦宜自謀，以諮諏善道，察納雅言。深追先帝遺詔，臣不勝受恩感激。\n\今當遠離，臨表涕泣，不知所云。";
const string赤壁賦 = "壬戌之秋，七月既望，蘇子與客泛舟遊於赤壁之下。清風徐來，水波不興，舉酒屬客，誦明月之詩，歌窈窕之章。少焉，月出於東山之上，徘徊於斗牛之間，白露橫江，水光接天；縱一葦之所如，凌萬頃之茫然。浩浩乎如憑虛御風，而不知其所止；飄飄乎如遺世獨立，羽化而登仙。\n於是飲酒樂甚，扣舷而歌之。歌曰：「桂棹兮蘭槳，擊空明兮泝流光。渺渺兮予懷，望美人兮天一方。」客有吹洞簫者，倚歌而和之，其聲嗚嗚然，如怨如慕，如泣如訴，餘音嫋嫋，不絕如縷。舞幽壑之潛蛟，泣孤舟之嫠婦。\n蘇子愀然，正襟危坐，而問客曰：「何為其然也？」\n客曰：「『月明星稀，烏鵲南飛』，此非曹孟德之詩乎？西望夏口，東望武昌，山川相繆，鬱乎蒼蒼，此非孟德之困於周郎者乎？方其破荊州，下江陵，順流而東也，舳艫千里，旌旗蔽空，釃酒臨江，橫槊賦詩，固一世之雄也，而今安在哉？況吾與子，漁樵於江渚之上，侶魚蝦而友麋鹿；駕一葉之扁舟，擧匏樽以相屬。寄蜉蝣於天地，渺滄海之一粟。哀吾生之須臾，羨長江之無窮。挾飛仙以遨遊，抱明月而長終。知不可乎驟得，託遺響於悲風。」\n蘇子曰：「客亦知夫水與月乎？逝者如斯，而未嘗往也；盈虛者如彼，而卒莫消長也，蓋將自其變者而觀之，則天地曾不能以一瞬；自其不變者而觀之，則物與我皆無盡也，而又何羨乎？且夫天地之間，物各有主，苟非吾之所有，雖一毫而莫取。惟江上之清風，與山間之明月，耳得之而為聲，目遇之而成色，取之無禁，用之不竭，是造物者之無盡藏也，而吾與子之所共適。」\n客喜而笑，洗盞更酌。肴核既盡，杯盤狼藉，相與枕藉乎舟中，不知東方之既白。";
const string蘭亭集序 = "永和九年，歲在癸丑，暮春之初，會於會稽山蔭之蘭亭，修禊事也。群賢畢至，少長咸集。此地有崇山峻嶺，茂林修竹，又有清流激湍，映帶左右。引以為流觴曲水，列坐其次，雖無絲竹管弦之盛，一觴一詠，亦足以暢幽情。是日也，天朗氣清，惠風和暢，仰觀宇宙之大，俯察品類之盛，所以游目騁懷，足以極視聽之娛，信可樂也。\n夫人之相與，俯仰一世，或取諸懷抱，晤言一室之內；或因寄所托，放浪形骸之外。雖取舍萬殊，靜躁不同，當其欣於所遇，暫得於己，快然自足，曾不知老之將至。及其所之既倦，情隨事遷，感慨系之矣。向之所欣，俯仰之間已為陳跡，猶不能不以之興懷；況修短隨化，終期於盡。古人云：「死生亦大矣。」豈不痛哉！\n每覽昔人興感之由，若合一契，未嘗不臨文嗟悼，不能喻之於懷，固知一死生為虛誕，彭殤為妄作。後之視今，亦猶今之視昔，悲夫！故列時人，錄其所述，雖世殊事異，所以興懷，其致一也。後之覽者，亦將有感於斯文。";
const string岳陽樓記 = "慶曆四年春，滕子京謫守巴陵郡。越明年，政通人和，百廢具興，乃重修岳陽樓，增其舊制，刻唐賢今人詩賦於其上；屬予作文以記之。\n予觀夫巴陵勝狀，在洞庭一湖。銜遠山，吞長江，浩浩湯湯，橫無際涯；朝暉夕陰，氣象萬千；此則岳陽樓之大觀也，前人之述備矣。然則北通巫峽，南極瀟湘，遷客騷人，多會於此，覽物之情，得無異乎？\n若夫霪雨霏霏，連月不開；陰風怒號，濁浪排空；日星隱曜，山嶽潛形；商旅不行，檣傾楫摧；薄暮冥冥，虎嘯猿啼。登斯樓也，則有去國懷鄉，憂讒畏譏，滿目蕭然，感極而悲者矣。\n至若春和景明，波瀾不驚，上下天光，一碧萬頃；沙鷗翔集，錦鱗游泳，岸芷汀蘭，郁郁青青。而或長煙一空，皓月千里，浮光躍金，靜影沉璧，漁歌互答，此樂何極。登斯樓也，則有心曠神怡，寵辱皆忘，把酒臨風，其喜洋洋者矣。\n嗟夫！予嘗求古仁人之心，或異二者之為，何哉？不以物喜，不以己悲。居廟堂之高，則憂其民；處江湖之遠，則憂其君。是進亦憂，退亦憂；然則何時而樂耶？其必曰：「先天下之憂而憂，後天下之樂而樂」歟！噫！微斯人，吾誰與歸？\n時六年九月十五日。";
